import { Component, DestroyRef, OnInit, inject } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { BlogService } from '../../core/services/blog.service';
import { Blog } from '../../core/interfaces/blog';
import { map } from 'rxjs';
import { DEFAULT_PROFILE_PHOTO_SRC } from '../../core/utils/constants';
import { CommonModule } from '@angular/common';
import { Title } from '@angular/platform-browser';
import { TooltipDirective } from '../../shared/Directives/tooltip.directive';
import { AddBlogComponent } from '../user-profile/add-blog/add-blog.component';

@Component({
  selector: 'app-blog',
  standalone: true,
  imports: [CommonModule, TooltipDirective, AddBlogComponent],
  templateUrl: './blog.component.html',
  styleUrl: './blog.component.scss',
})
export class BlogComponent implements OnInit {
  private activatedRoute = inject(ActivatedRoute);
  private blogService = inject(BlogService);
  private destroyRef = inject(DestroyRef);
  private router = inject(Router);
  private titleService = inject(Title);
  blog: Blog | null = null;
  default_profile_photo: string = DEFAULT_PROFILE_PHOTO_SRC;
  isMyBlog: boolean = false;
  clickedBTN: string | null = null;
  ngOnInit(): void {
    const routeSubscription = this.activatedRoute.paramMap.subscribe({
      next: (paramMap) => {
        const blogID = paramMap.get('id');
        const blogSubcription = this.blogService.blogs$
          .pipe(
            map((arr) =>
              arr?.filter((blog: Blog) => blog.id.toString() === blogID)
            )
          )
          .subscribe((blogs) => {
            this.blog = blogs?.[0] ?? {
              title:
                'Unveiling the Enchanting Amiakhum Waterfall: A Bangladesh Adventure ',
              description:
                "<p><strong>Introduction:</strong></p>\n<p>Nestled amidst the verdant hills of Bangladesh lies a hidden gem waiting to be discovered: the majestic Amiakhum Waterfall. Located in the heart of the Chittagong Hill Tracts, Amiakhum offers a breathtaking experience for nature lovers and adventure seekers alike.</p>\n<p><strong>A Journey Through Untamed Beauty:</strong></p>\n<p>Reaching Amiakhum is an adventure in itself. The journey begins with a scenic drive through winding roads, traversing lush forests and offering glimpses of the stunning vistas that await. Prepare for a day and a half of moderate to challenging trekking, as Amiakhum sits deep within the hills.</p>\n<p><strong>The Grand Cascade Revealed:</strong></p>\n<p>As you conquer the path and emerge into a clearing, the reward for your efforts unfolds &ndash; the awe-inspiring Amiakhum Waterfall. The mighty cascade tumbles down sheer rock walls, creating a mesmerizing spectacle. The sound of crashing water fills the air, a symphony of nature's power and beauty.</p>\n<p><strong>A Sanctuary for the Senses:</strong></p>\n<p>Surrounded by lush greenery and towering mountains, Amiakhum offers a serene escape from the hustle and bustle of everyday life. Take a refreshing dip in the cool waters at the base of the falls, or simply relax on the rocks and soak in the tranquility of the surroundings.</p>\n<p><strong>Beyond the Waterfall:</strong></p>\n<p>The region surrounding Amiakhum is a treasure trove for those seeking a deeper connection with nature. Explore the diverse flora and fauna, encounter unique birdlife, or simply marvel at the breathtaking panoramic views.</p>\n<p><strong>Planning Your Amiakhum Adventure:</strong></p>\n<p>Reaching Amiakhum requires careful planning. Consider traveling during the dry season (October to March) for optimal trekking conditions. Obtaining necessary permits from local authorities and hiring experienced guides are crucial for a safe and enjoyable journey.</p>\n<p><strong>A Call to the Adventurous Soul:</strong></p>\n<p>Amiakhum is not for the faint of heart. It's a challenging yet rewarding adventure that promises a glimpse into the untouched beauty of Bangladesh. For those who crave the thrill of exploration and the serenity of nature, Amiakhum beckons.</p>\n<p><strong>Sharing Your Experience:</strong></p>\n<p>Document your Amiakhum adventure! Capture the breathtaking scenery, the exhilarating trek, and the serene atmosphere of the waterfall. Share your photos and stories on social media, inspiring others to embark on their own journeys of discovery in Bangladesh.</p>\n<p><strong>Parting Words:</strong></p>\n<p>Amiakhum is more than just a waterfall; it's an experience. It's a testament to the power of nature, a test of your resilience, and a reminder of the beauty that awaits those who venture off the beaten path. So, pack your bags, lace up your boots, and prepare to be captivated by the magic of Amiakhum.</p>\n<p><strong>Additional Tips:</strong></p>\n<ul>\n<li>Include captivating photos of the waterfall, the surrounding landscape, and yourself enjoying the experience.</li>\n<li>Consider mentioning the cultural significance of the area, if any.</li>\n<li>Briefly mention the local cuisine or any unique aspects of the region.</li>\n<li>End with a call to action, encouraging readers to explore Amiakhum themselves.</li>\n</ul>\n<p>By incorporating these suggestions, you can create an engaging and informative blog post that will inspire others to discover the beauty of Amiakhum Waterfall.</p>",
              tags: [
                'Technology fdfadsasASDASASASDDSAADSDSADSAS',
                'Adventure',
                'Nature',
                'Tourism',
              ],
              blogImage:
                'data:image/jpeg;base64,',
              postingDate:
                'Fri Jul 26 2024 12:03:45 GMT+0600 (Bangladesh Standard Time)',
              bloggerName: 'Jane Sue',
              bloggerImage:
                'data:image/jpeg;base64,',
              bloggerId: 1,
              id: 2,
            };
            if (this.blog === null) {
              this.router.navigate(['']);
            } else {
              this.titleService.setTitle(this.blog.title);
              this.isMyBlog = this.blogService.isMyBlog(this.blog?.bloggerId);
            }
          });
        this.destroyRef.onDestroy(() => blogSubcription.unsubscribe());
      },
    });
    this.destroyRef.onDestroy(() => routeSubscription.unsubscribe());
  }
  clickedHeaderBTN(btn: string): void {
    this.clickedBTN = btn;
  }
  handleAddFormSubmitted(formSubmitted: string | null): void {
    this.clickedBTN = formSubmitted;
  }
}
